/*Table structure for table `tpp_cinema_hall` */

DROP TABLE IF EXISTS `tpp_cinema_hall`;

CREATE TABLE `tpp_cinema_hall` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `hall_id` int(11) NOT NULL,
  `cinema_id` int(11) NOT NULL,
  `hall_name` varchar(50) NOT NULL,
  `price` varchar(50) NOT NULL,
  `service_fee` varchar(50) NOT NULL DEFAULT '200' COMMENT '服务费（分）',
  `max_row` varchar(50) NOT NULL,
  `min_row` varchar(50) NOT NULL,
  `max_column` varchar(50) NOT NULL,
  `min_column` varchar(50) NOT NULL,
  `max_top_px` varchar(50) NOT NULL DEFAULT '30',
  `min_top_px` varchar(50) NOT NULL DEFAULT '30',
  `max_left_px` varchar(50) NOT NULL DEFAULT '30',
  `min_left_px` varchar(50) NOT NULL DEFAULT '30',
  `regular` varchar(50) NOT NULL DEFAULT '1' COMMENT 'true 使用行列，false使用坐标',
  `max_can_buy` varchar(50) NOT NULL DEFAULT '4',
  `hall_status` varchar(50) NOT NULL DEFAULT '1',
  `creattime` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8;

