/*Table structure for table `tpp_cinema_hall_seat` */

DROP TABLE IF EXISTS `tpp_cinema_hall_seat`;

CREATE TABLE `tpp_cinema_hall_seat` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `hall_id` varchar(50) DEFAULT NULL COMMENT '影厅编号',
  `ext_id` varchar(50) DEFAULT NULL COMMENT '座位id编号',
  `top_px` varchar(50) DEFAULT NULL COMMENT '座位top偏移量，绘制座位图时的css样式，为30的倍数，例：top:30px',
  `left_px` varchar(50) DEFAULT NULL COMMENT '座位left偏移量，绘制座位图时的css样式，为30的倍数，例：left:30p',
  `seat_column` varchar(50) DEFAULT NULL COMMENT '列',
  `seat_row` varchar(50) DEFAULT NULL COMMENT '行',
  `row_name` varchar(50) DEFAULT NULL COMMENT '行名称',
  `seat_name` varchar(50) DEFAULT NULL COMMENT '座位名称',
  `area` varchar(50) DEFAULT NULL COMMENT '座位区域.支持影院分区定价功能 1.如果为空，代表非分区定价的场次.无需对价格进行特殊处理 2.如果不为空，需要判断该排期是否分区定价的排期（判断条件参照排期接口的字段说明）。如果是分区定价的排期，使用该字段从排期的分区模型里面获取该座位的真实金额，用于下单出票，否则金额传入不正确，会被直接提示出票失败 3.该字段为预留字段。目前无该业务，分区定价业务上线后，需要渠道方和淘票票对接，否则影响分区场次的下单出票',
  `default_status` varchar(50) DEFAULT '1' COMMENT '默认 座位状态:1：可售，0：不可售，-1：删除(非法)',
  `flag` varchar(50) DEFAULT '0' COMMENT '座位标识。0：普通座位，1：情侣首座(左座)，2：情侣第二座(右座)',
  `creattime` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=244 DEFAULT CHARSET=utf8;

