/*Table structure for table `tpp_cinema_schedule_seats` */

DROP TABLE IF EXISTS `tpp_cinema_schedule_seats`;

CREATE TABLE `tpp_cinema_schedule_seats` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `seat_id` varchar(32) DEFAULT NULL COMMENT '座位ID',
  `schedules_id` varchar(32) DEFAULT NULL COMMENT '排期ID',
  `cinema_id` varchar(32) DEFAULT NULL COMMENT '影院ID',
  `hall_id` varchar(32) DEFAULT NULL COMMENT '影厅ID',
  `show_id` varchar(32) DEFAULT NULL COMMENT '影片ID',
  `show_date` varchar(32) DEFAULT NULL COMMENT '放映日期',
  `show_time` varchar(32) DEFAULT NULL COMMENT '放映时间',
  `show_version` varchar(32) DEFAULT NULL COMMENT '影片版本',
  `close_time` varchar(32) DEFAULT NULL COMMENT '放映结束时间',
  `hall_name` varchar(32) DEFAULT NULL COMMENT '影厅名称',
  `price` varchar(32) DEFAULT NULL COMMENT '座位价格',
  `service_fee` varchar(32) DEFAULT NULL COMMENT '服务费',
  `section_id` varchar(32) DEFAULT NULL,
  `schedule_area` varchar(32) DEFAULT NULL,
  `ext_id` varchar(32) DEFAULT NULL,
  `top_px` varchar(4) DEFAULT NULL,
  `left_px` varchar(4) DEFAULT NULL,
  `seat_column` varchar(32) DEFAULT NULL,
  `seat_row` varchar(32) DEFAULT NULL,
  `row_name` varchar(32) DEFAULT NULL,
  `seat_name` varchar(32) DEFAULT NULL,
  `area` json DEFAULT NULL,
  `flag` varchar(2) DEFAULT NULL,
  `seat_status` varchar(1) DEFAULT NULL COMMENT '座位状态:1：可售，0：不可售，-1：删除(非法)',
  `islocked` varchar(1) DEFAULT '0' COMMENT '座位是否为锁定（1为锁定，0为已解锁）',
  `locktime` varchar(32) DEFAULT NULL COMMENT '锁座时间',
  `creattime` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  KEY `id` (`id`)
