/*Table structure for table `tpp_cinema_schedules` */

DROP TABLE IF EXISTS `tpp_cinema_schedules`;

CREATE TABLE `tpp_cinema_schedules` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `schedules_id` varchar(32) NOT NULL,
  `cinema_id` varchar(32) NOT NULL COMMENT '影院ID',
  `hall_id` varchar(32) NOT NULL COMMENT '影厅ID',
