/*Table structure for table `tpp_cinemaslist` */

DROP TABLE IF EXISTS `tpp_cinemaslist`;

CREATE TABLE `tpp_cinemaslist` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '影院id',
  `cinema_name` varchar(32) DEFAULT NULL COMMENT '影院名称',
  `cinema_id` varchar(32) DEFAULT NULL COMMENT '广电总局发放给影院的8位标准影院编码',
  `city_id` varchar(32) DEFAULT NULL COMMENT '影院所属城市id',
  `region_name` varchar(32) DEFAULT NULL COMMENT '影院所属区域名',
  `address` varchar(32) DEFAULT NULL COMMENT '地址',
  `latitude` varchar(32) DEFAULT NULL COMMENT '影院纬度',
  `longitude` varchar(32) DEFAULT NULL COMMENT '影院经度',
  `phone` varchar(32) DEFAULT NULL,
  `schedule_close_time` varchar(32) DEFAULT NULL COMMENT '影院场次提前关闭时间，单位分钟',
  `standard_id` varchar(32) DEFAULT NULL,
  `support_third_party_refund` int(2) DEFAULT '1',
  `min_time_line` varchar(8) DEFAULT '1440' COMMENT '距离开场前退票时间（以分钟为单位）用户可退',
  `creattime` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

