  `open_time` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '首映日期格式：YYYY-MM-DD,YYYY-MM，已废弃',
  `highlight` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '精彩点评',
