insert  into `tpp_film`(`id`,`show_id`,`show_name`,`show_name_en`,`director`,`leading_role`,`filmtype`,`country`,`language`,`duration`,`open_day`,`remark`,`description`,`show_mark`,`open_time`,`highlight`,`poster`,`background_picture`,`trailer_list`,`show_version_list`,`isplay`,`schedules_state`,`creat_time`) values (1,'123456','历险记','历险记','李连杰','刘德华','惊悚','英国','English','123','2017-02-01 12:00:00','9.7','描述','英语3D','2017-02-01','尿点十足','xxxx.jpg','xxxx.jpg','xxxx.jpg','3D','0','0','2018-09-07 18:14:19'),(2,'001304962018','我不是药神','Dying to Survive','文牧野','徐峥，王传君，周一围,谭卓，章宇，杨新鸣','喜剧','中国','汉语','117','2018-08-07 00:00:00','9.0','普通中年男子程勇（徐峥 饰）经营着一家保健品店，失意又失婚。不速之客吕受益（王传君 饰）的到来，让他开辟了一条去印度买药做“代购”的新事业，虽然困难重重，但他在这条“买药之路”上发现了商机，一发不可收拾地做起了治疗慢粒白血病的印度仿制药独家代理商。赚钱的同时，他也认识了几个病患及家属，为救女儿被迫做舞女的思慧（谭卓 饰）、说一口流利“神父腔”英语的刘牧师（杨新鸣 饰），以及脾气暴烈的“黄毛”（章宇 饰），几个人合伙做起了生意，利润倍增的同时也危机四伏。程勇昔日的小舅子曹警官（周一围 饰）奉命调查仿制药的源头，假药贩子张长林（王砚辉 饰）和瑞士正牌医药代表（李乃文 饰）也对其虎视眈眈，生意逐渐变成了一场关于救赎的拉锯战。 本片改编自慢粒白血病患者陆勇代购抗癌药的真实事迹。','IMAX','2018-08-07','风骚无限','https://p1.ssl.qhmsg.com/dr/270_500_/t01591033f317d462f9.png','https://p1.ssl.qhmsg.com/dr/270_500_/t01591033f317d462f9.png','https://p1.ssl.qhmsg.com/dr/270_500_/t01591033f317d462f9.png','IMAX','1','1','2018-09-06 16:35:04'),(154,'001X07112018','母亲泪',NULL,NULL,NULL,'故事片','中国',NULL,NULL,'2018-09-10 00:00:00',NULL,NULL,NULL,'2018-09-10',NULL,NULL,NULL,NULL,'普通','0','0','2018-09-10 16:35:11'),(155,'001X07102018','御林九处之百重杀',NULL,NULL,NULL,'故事片','中国',NULL,NULL,'2018-09-10 00:00:00',NULL,NULL,NULL,'2018-09-10',NULL,NULL,NULL,NULL,'普通','0','0','2018-09-10 16:35:11'),(156,'001X07092018','御林九处之千钧镇',NULL,NULL,NULL,'故事片','中国',NULL,NULL,'2018-09-10 00:00:00',NULL,NULL,NULL,'2018-09-10',NULL,NULL,NULL,NULL,'普通','0','0','2018-09-10 16:35:11'),(157,'001X07082018','茶缘',NULL,NULL,NULL,'故事片','中国',NULL,NULL,'2018-09-10 00:00:00',NULL,NULL,NULL,'2018-09-10',NULL,NULL,NULL,NULL,'普通','0','0','2018-09-10 16:35:11'),(158,'001X07072018','温州青年之海阔天空',NULL,NULL,NULL,'故事片','中国',NULL,NULL,'2018-09-10 00:00:00',N