/*Table structure for table `tpp_regions` */

DROP TABLE IF EXISTS `tpp_regions`;

CREATE TABLE `tpp_regions` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `parent_id` int(8) DEFAULT NULL,
  `region_name` varchar(32) DEFAULT NULL,
  `city_code` varchar(8) DEFAULT NULL,
  `pin_yin` varchar(32) DEFAULT NULL,
  `creat_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='淘票票地区';

