/*Table structure for table `tpp_translog` */

DROP TABLE IF EXISTS `tpp_translog`;

CREATE TABLE `tpp_translog` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `transId` varchar(64) DEFAULT NULL COMMENT '平台订单号',
  `tb_order_id` varchar(64) DEFAULT NULL COMMENT '商户订单号',
  `user_id` varchar(64) DEFAULT NULL COMMENT '用户ID',
  `schedule_id` varchar(64) DEFAULT NULL COMMENT '排期ID',
  `apply_key` varchar(64) DEFAULT NULL COMMENT '锁座ID',
  `seat_ids` varchar(64) DEFAULT NULL COMMENT '座位ID',
  `mobile` varchar(50) DEFAULT NULL COMMENT '用户手机',
  `params` json DEFAULT NULL COMMENT '参数',
  `ext_user_id` varchar(50) DEFAULT NULL COMMENT '购票用户ID',
  `ticket_contents` varchar(50) DEFAULT NULL COMMENT '取票码',
  `total_price` varchar(32) DEFAULT NULL COMMENT '订单金额',
  `order_status` varchar(4) DEFAULT NULL COMMENT '0 锁座未支付 1 支付成功 2.支付出票',
  `creattime` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

